import "./login.css"
import logo from "./assets/lg.png"

export default function Login() {
  return (
    <div className="head-l">
      <div className="logo">
        
        <span ><img className="lib-lg" src={logo} alt="" /><div className="txt-lg"><b>eLibrary</b></div></span>
      </div>
    </div>
  );
}
